	public static String decoderBase64File(String base64Code)throws Exception{
		String str = null;
		byte[] buffer = new BASE64Decoder().decodeBuffer(base64Code);
//		System.out.println("3333333333333"+buffer);
		byte[] b = uncompress(buffer);
		
//		System.out.println("666666666"+b);
		String s = new String(b,"UTF-8");
//		System.out.println("777777"+s);
	    str = new String(buffer,"UTF-8");
	    return s;
	}
	
	// 解压缩
	public static byte[] uncompress(byte[] data) throws IOException {
		if (data == null || data.length == 0) {
			return data;
		}
		ByteArrayOutputStream out = new ByteArrayOutputStream();
		ByteArrayInputStream in = new ByteArrayInputStream(data);
		GZIPInputStream gunzip = new GZIPInputStream(in);
		byte[] buffer = new byte[256];
		int n;
		while ((n = gunzip.read(buffer)) >= 0) {
			out.write(buffer, 0, n);
		}
		gunzip.close();
		in.close();
		return out.toByteArray();
	}
		
	//单笔个人征信请求报文
	public static String getPerRequest(PageData pd) throws Exception{
		StringBuffer strBuf = new StringBuffer();
		strBuf.append(ReportUtil.headInfo(pd.getString("QUERY_ORG_CODE"),pd.getString("RECE_ORG_CODE"),"D101"));
		strBuf.append("<?xml version=\"1.0\" encoding=\"UTF-8\"?>");
		strBuf.append("<Document>");
		strBuf.append("<Head>");
		strBuf.append("<QueryOrgCode>"+pd.getString("QUERY_ORG_CODE")+"</QueryOrgCode>");
		strBuf.append("<UserCode>"+pd.getString("USERNAME_PERBANK")+"</UserCode>");
		strBuf.append("<Password>"+SM3Digest.SM3OfUpper(PasswordOper.decode(pd.getString("PASSWORD")))+"</Password>");
		strBuf.append("</Head>");
		strBuf.append("<Msg>");
		strBuf.append("<OriginateOrgCode>"+pd.getString("ORIGINATE_ORG_CODE")+"</OriginateOrgCode>");//发起机构代码
		strBuf.append("<OriginateUserCode>"+pd.getString("ORIGINATE_USER_CODE")+"</OriginateUserCode>");//发起用户代码
		strBuf.append("<Name>"+pd.getString("CLIENT_NAME")+"</Name>");
		strBuf.append("<IDType>"+pd.getString("ID_TYPE")+"</IDType>");
		strBuf.append("<IDNum>"+pd.getString("ID_NUM")+"</IDNum>");
		strBuf.append("<QueryReason>"+pd.getString("QUERY_REASON")+"</QueryReason>");
		strBuf.append("<ServiceCode>"+pd.getString("SERVICE_CODE")+"</ServiceCode>");
		strBuf.append("</Msg>");
		strBuf.append("</Document>");
		strBuf.append("{S:"+ReportUtil.numSignature(strBuf.toString())+":S}"); //数字签名
		logger.info("***********个人报告请求报文***********");
		logger.info(strBuf.toString());
		return strBuf.toString();
	}
